import _ from 'lodash';


/**
 * cookie解码函数
 * @param str
 * @returns {string}
 * @constructor
 */
const DecodeCookie = (str: string) => {
    let strArr: any = '';
    let strRtn: string = '';
    strArr = str.split('a');
    for (let i = _.size(strArr) - 1; i >= 0; i--) {
        // tslint:disable-next-line:no-eval
        strRtn += String.fromCharCode(eval(strArr[i]));
    }
    return strRtn;
};

export default {
    DecodeCookie,
};
